import headerLogo from '../images/logotype.svg';
import { Link } from 'react-router-dom';

function Header() {
    return (
        <header className="header">
            <img src= {headerLogo} alt="Логотип" className="header__logo" />
            <div>
                <Link>Регистрация</Link>
                <Link>Войти</Link>
                <Link>Выйти</Link>
            </div>
        </header>
    );
  }

  export default Header;
